import React, { Component } from "react";
import Sidebar from "./components/Sidebar/Sidebar";
import Header from "./components/Header/Header";
import Feed from "./components/Feed/Feed";
import Widgets from "./components/Widgets/Widgets";
import Register from "./components/Register/Register";
import "bootstrap/dist/css/bootstrap.min.css";
import Home from "./components/Home/Home";
import "./App.css";
import { withCookies } from "react-cookie";
import { BrowserRouter, Switch, Route, Redirect, Link } from "react-router-dom";
import Login from "./components/Login/Login";
import Profile from "./components/Profile/Profile";
import ActivityLeft from "./components/Profile/ActivityLeft";
import ActivityMain from "./components/Profile/ActivityMain";
import ActivityRight from "./components/Profile/ActivityRight";
import GenerateData from "./components/GenerateData";

class App extends Component {
  componentDidMount() {
    if (!this.props.cookies.get("auth-token")) {
      console.log("hello");
      <Redirect to={"/home"} />;
    } else {
      <Redirect to={"/"} />;
    }
  }

  render() {
    return (
      <BrowserRouter>
        <div>
          <Switch>
            <Route>
              <div className="app">
                {/*  To generate multiple post at a time (Devlopement purpose) */}
                {/* <GenerateData /> */}
                <div className="app__body">
                  <Route
                    exact
                    path="/login"
                    render={(props) => <Login {...props} />}
                  />
                  <Route
                    exact
                    path="/join_now"
                    component={() => <Register />}
                  />
                  <Route
                    exact
                    path="/"
                    component={() =>
                      this.props.cookies.get("auth-token") ? (
                        <div>
                          {" "}
                          <Header />
                          <Sidebar />
                          <Feed />
                          <Widgets />
                        </div>
                      ) : (
                        <Home />
                      )
                    }
                  ></Route>
                  <Route exact path="/profile" component={() => <Profile />} />
                  <Route exact path="/activity">
                    <ActivityLeft />
                    <ActivityMain />
                    <ActivityRight />
                  </Route>
                </div>
              </div>
            </Route>
          </Switch>
        </div>
      </BrowserRouter>
    );
  }
}

export default withCookies(App);
